import React, { Component } from 'react';
import { variables } from './Variables.js';

export class Home extends Component {
    constructor(props) {
        super(props);

        this.state = {
            PhotoPath: variables.PHOTO_URL
        }
    }

    render() {
        const {
            PhotoPath,
        } = this.state;
        return (
            <div>
                <br />
                <div>
                    <img width="250px" height="300px" align="left" src={PhotoPath + 'Manuel_perfil.jpeg'} />
                </div>
                <h3>Desarrollado por: Manuel Eduardo Rivera Argueta</h3>
            </div>
        )
    }
}
